import React from 'react';
import './Navbar.css'


const Navbar = () =>{
    return(
        <nav className='nav col-xl-2'>
          <ul>
            <li>Profile</li>
            <li>Messages</li>
            <li>News</li>
            <li>Settings</li>
            <li>Music</li>
          </ul>
        </nav>
    )
}
export default Navbar;
